import React, { Component } from 'react';
import ReactContactForm from 'react-mail-form';
import { Route, Link } from 'react-router-dom';
import { Card } from './Components/Card';
import './App.css';

const contact = <ReactContactForm to="wnjhwng@gmail.com" className="email-form" />;


class App extends Component {
  render() {
    return (
      <div className="main">
        <div className="card-container">
          <Route
            exact
            path="/"
            render={() =>
              <Card title="Wonjae Hwang" footer="EST. 2020">
                <ul className="card-list">
                  <li className="card-list-item"><Link to="/about">About</Link></li>
                  <li className="card-list-item"><Link to="/portfolio">Portfolio</Link></li>
                  <li className="card-list-item"><Link to="/contact">Contact</Link></li>
                </ul>
              </Card>}
          />
          <Route
            path="/about"
            render={() =>
              <Card title="About" footer={<Link to="/">Home</Link>}>
                <ul className="card-content-container">
                  <div>Wonjae Hwang</div>
                  <div>Lambda School Feb 2019</div>
                </ul>
              </Card>}
          />
          <Route
            path="/portfolio"
            render={() =>
              <Card title="Portfolio" footer={<Link to="/">Home</Link>}>
                <ul className="card-content-container">
                  PORTFOLIO
                </ul>
              </Card>}
          />
          <Route
            path="/contact"
            render={() =>
              <Card title="Contact" footer={<Link to="/">Home</Link>}>
                <ul className="card-content-container">
                  CONTACT
                </ul>
              </Card>}
          />
        </div>
      </div >
    );
  }
}

export default App;
